package casting;

public class Casting {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int numero = 10;
		double numero2 = 7878.0;
		
		int conversio1 = (int) numero2;
		System.out.println(conversio1);
		
		double conversio2 = numero;
		System.out.println(conversio2);
		
	}

}
